import React from "react";
import { iconSchmooz } from "./assets/svgFunction/iconSchmooz";
import { ColorString } from "./ColorPalette";
import "./css/Common.css";
import "./css/Body.css";

export function Head() {
  return (
    <header className="sticky-thc">
      <div
        className="text-medium hide-mobile"
        style={{
          display: "flex",
          alignContent: "center",
          justifyContent: "center",
          flexDirection: "row",
          padding: 10,
          height: 58,
          backgroundColor: ColorString.schmoozGreen,
        }}
      >
        {iconSchmooz()}
        <svg
          // style={{ display: "flex", flex: 1 }}
          className="show-mobile"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
          // width="300"
          height="53"
          viewBox="0 0 250 75"
          preserveAspectRatio="XminYmin meet"
        >
          <image
            className="show-mobile"
            x={"-5"}
            y={"5%"}
            width="100%"
            height="100%"
            href="schmooz-text.svg"
          />
        </svg>

        <div
          className="header-web"
          style={{
            flex: 1,
            flexDirection: "row",
            justifyContent: "space-evenly",
            textDecoration: "none",
            alignItems: "center",
            backgroundColor: ColorString.transparent,
          }}
        >
          <a
            className="text-medium header-web"
            style={{
              textDecoration: "none",
              color: ColorString.white,
              fontWeight: "bold",
              fontSize: 20,
              backgroundColor: ColorString.transparent,
            }}
            href="about.html"
          >
            About
          </a>
          <a
            className="text-medium header-web"
            style={{
              fontSize: 20,
              textDecoration: "none",
              color: ColorString.white,
              fontWeight: "bold",
              backgroundColor: ColorString.transparent,
            }}
            href="terms.html"
          >
            Terms
          </a>
          <a
            className="text-medium header-web"
            style={{
              fontSize: 20,
              textDecoration: "none",
              color: ColorString.white,
              fontWeight: "bold",
              backgroundColor: ColorString.transparent,
            }}
            href="mailto:rob@schmooz.app"
          >
            Contact
          </a>
        </div>
        <div style={{ backgroundColor: "red" }}></div>
      </div>
      <svg
        className="svg-header"
        viewBox="0 0 200 200"
        fill="red"
        height={50}
        width={50}
        preserveAspectRatio="xMinYMin meet"
        xmlns="http://www.w3.org/2000/svg"
      >
        <image className="show-mobile" href="sandwich-menu.svg" />
      </svg>
    </header>
  );
}
